import React from "react";
const DeleteBorder = styled(Card)`
  border: 0px;
`;
const topnavbar = () => {
  return (
    <Row>
      <Col md="5" xs="1"></Col>
      <Col md="2" xs="6">
        <TopNavBarItemText to="/">
          <TopNavBarTitleLogoMoblie onClick={init}>
            <DeleteBorder>
              <CardImg
                top
                width="100%"
                src={require("./sajubaju.png")}
                alt="Card image cap"
              />
            </DeleteBorder>
          </TopNavBarTitleLogoMoblie>
        </TopNavBarItemText>
      </Col>
      <Col md="3" xs="1">
        {/*  {signInfo.name === "" ? <div></div> : <div>{signInfo.name}</div>}*/}
      </Col>

      <Col xs="2">
        {signInfo.kakaoId === "" ? (
          <Link to="/signin">
            <Button outline color="info">
              signin
            </Button>
          </Link>
        ) : (
          <Link to="/">
            <Button onClick={logout} outline color="info">
              logout
            </Button>
          </Link>
        )}
      </Col>
    </Row>
  );
};

export default topnavbar;
